def get_xdr_token(i, s):
    url = f'{xdr_url}/iroh/oauth2/token'
    b64 = base64.b64encode((i + ':' + s).encode()).decode()
    header = {
        'Content-Type': 'application/x-www-form-urlencoded',
        'Accept': 'application/json',
        'Authorization': 'Basic ' + b64
    }
    payload = 'grant_type=client_credentials'
    response = requests.post(url, headers=header, data=payload)
    if response.status_code == 200:
        return response.json()['access_token']


token = get_xdr_token(user, pwd)


def xdr_get(path):
    url = f'{automation_url}{path}'
    header = {
        'Authorization': 'Bearer ' + token,
        'Content-Type': 'application/json'
    }
    response = requests.get(url, headers=header)
    if response.status_code == 200:
        return response.json()


def xdr_post(path, data={}):
    url = f'{automation_url}{path}'
    header = {
        'Authorization': f'Bearer {token}'
    }
    if data != {}:
        data = json.dumps(data)
    response = requests.post(url, headers=header, data=data)
    return response


def create_category(name, schema):
    data = {
        "category_type": "custom",
        "name": name,
        "schema_id": schema,
        "title": name
    }
    xdr_post('/api/v1/categories', data)

